function cargarpanel(id){
  db.transaction(
        function(tx) {
        tx.executeSql('SELECT * FROM gastronomia WHERE id=?',[id],
        function(tx,results){
            if(results.rows.item(0).telefono1!=''){var tel1="<b><a href='tel:"+results.rows.item(0).telefono1+"'>"+results.rows.item(0).telefono1+"</a></b>";}else{var tel1='';}
            if(results.rows.item(0).telefono2!=''){var tel2="<b><a href='tel:"+results.rows.item(0).telefono2+"'>"+results.rows.item(0).telefono2+"</a></b>";}else{var tel2='';}
            if(results.rows.item(0).email!=''){var email="<p>Correo electrnico:<br /><b><a style='word-wrap: break-word' href='mailto:"+results.rows.item(0).email+"?subject= Solicitud de informacion'>"+results.rows.item(0).email+"</a></b></p>";}else{var email='';}
            if(results.rows.item(0).web!=''){var web="<p>Pgina de internet:<br /><b><a style='word-wrap: break-word' href='#' class='link' onclick=window.open('"+results.rows.item(0).web+"','_blank','location=yes') >"+results.rows.item(0).web+"</a></b></p>";}else{var web='';}
            $("#mypanelgas #datos").html("<p>Horario:<br /><b>"+results.rows.item(0).horario+"</b> </p><p>Direcci&oacute;n:<br /><b>"+results.rows.item(0).direccion+"</b></p><p>Tel&eacute;fono:<br />"+tel1+"<br>"+tel2+email+web);
            if ($('#map_res').is(':visible'))setTimeout(function(){initmapres(results.rows.item(0).coordenadas)},100);$( "#mypanelgas" ).panel( "open" );

        });
    });
}

