function cargarhotel(id){
    $("#contenthotel").html('');
   db.transaction(
        function(tx) {
        tx.executeSql('SELECT * FROM hoteles where id=?',[id],
        function(tx,results){  
            var estrellas='';
            if(results.rows.item(0).estrellas.length>1){
                estrellas="<span>"+results.rows.item(0).estrellas+"</span>";
            }else{
            for(var x=0; x<results.rows.item(0).estrellas; x++){
                    estrellas +="<img src='img/estrella.png' />";
                }
                }
            if(results.rows.item(0).habitaciones!=''){var habit="<p>Cuenta con <b>"+results.rows.item(0).habitaciones+"</b> habitaciones.</p>"}else{var habit='';}    
            if(results.rows.item(0).email!=''){var email="<p>Correo electrnico:<br /><b><a style='word-wrap: break-word' href='mailto:"+results.rows.item(0).email+"?subject= Solicitud de informacion'>"+results.rows.item(0).email+"</a></b></p>";}else{var email='';}
            if(results.rows.item(0).web!=''){
                var web="<p>Pgina de internet:<br /><b><a style='word-wrap: break-word' href='#' class='link' onclick=window.open('"+results.rows.item(0).web+"','_blank','location=yes') >"+results.rows.item(0).web+"</a></b></p>";
            }else{var web='';}
           $("#contenthotel").append("<p style='text-align:right;margin:0'>"+estrellas+"</p>"+
           "<h2 style='text-align: center;margin:0'>"+results.rows.item(0).hotel+"</h2>"+
           habit+          
           "<p><span>Telfono:</span><br /><a href='tel:"+results.rows.item(0).telefono1+"'>"+results.rows.item(0).telefono1+"</a><br /><a href='tel:"+results.rows.item(0).telefono2+"'>"+results.rows.item(0).telefono2+"</a></p>"+
           email+web+
           "<p><span>Direccin: </span>"+results.rows.item(0).direccion+"</p>");
           setTimeout(function(){initmapres3(results.rows.item(0).coordenadas)},1000);
        });
    });  
}
